commit_message:
Make handling of blank lines around import blocks deterministic in the presence of comments Previously:

$ google-java-format --skip-sorting-imports T.java package p;

/** */
import a.A;

class T {
  A a;
}

$ google-java-format T.java
package p;

/** */

import a.A;

class T {
  A a;
}

