MOE_MIGRATED_REVID=180216554

Don't break up prefixes of `/` in line comments We still rewrite `//foo` to `// foo` but if the prefix is a
run of forward slashes the whitespace is probably not desired,
e.g.:

////////////////////////////////////////
// Header
////////////////////////////////////////

