Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=162646497

Preserve columnized arrays, even if they have a single column This change preservers existing whitespace for arrays where each element
is on a separate line, e.g.:

new int[]{
  1,
  2,
  3,
};

Previously this was only done if each row had two or more elements:

new int[]{
  1, 2,
  3, 4,
  5, 6,
};

