MOE_MIGRATED_REVID=154193916

Fix indentation of for loop variable declarations with multiple declaration fragments. Previously there was an extra +4 indent:

for (int x = 1, //
        y = 2; ; ) {}

The indent handling is only needed if the first fragment is not a declaration:

int x, y;
for (x = 1, //
        y = 2; ; ) {}

