Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=154189693

Indent trailing close parens in method calls The style guide requires at least a +4 indent for all continuation lines,
including trailing ')' e.g.:

f(
   x, // line comment
   y // line comment
   );

Also, calls with a single parameter and a line comment are now broken before
the parameter:

f(
   x // line comment
   );

Previously there was no break:

f(x // line comment
   );
