MOE_MIGRATED_REVID=114125275

Fix breaking between field declarations. The goal is to force line breaks between field declarations with vertical declaration annotations:

@Nullable
ImmutableList<String> names = someLongInitializer;

@Nullable
ImmutableList<Integer> ids = someOtherLongInitializer;

And delete blank lines between field declarations that fit on one line:

@Nullable int x = 1;
@Nullable int y = 2;

Previously making breaking decisions and writing output happened in a single
pass, so there was no way to "backtrack" after deciding to lay out a field's
declaration annotation vertically and add the leading blank line. The
implementation mistook existing leading blank lines for a decision to break
the current field declaration, and would (non-idempotently) add blank lines
between single-line field declarations. E.g. this:

class Test {

  @Nullable int x = 1;
  @Nullable int y = 2;
  @Nullable int z = 2;
}

Would be formatted to:

class Test {

  @Nullable int x = 1;

  @Nullable int y = 2;
  @Nullable int z = 2;
}

And then, after another pass:

class Test {

  @Nullable int x = 1;

  @Nullable int y = 2;

  @Nullable int z = 2;
}

This CL separates the formatting algorithm into two phases: (1) makes all
breaking decisions, and (2) writes the output. Decisions about adding or
removing blank lines happen in (2), after all breaking decisions are made. This
is safe because adding blank lines never affects breaking decisions.
